// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract MilesSwap {
    struct SwapOffer {
        address offerer;
        address recipient;
        address tokenOffered;
        address tokenRequested;
        uint256 amountOffered;
        uint256 amountRequested;
        bool accepted;
        bool canceled;
    }

    mapping(uint256 => SwapOffer) public swapOffers;
    uint256 public nextOfferId;

    event SwapOfferCreated(
        uint256 offerId,
        address indexed offerer,
        address tokenOffered,
        uint256 amountOffered,
        address tokenRequested,
        uint256 amountRequested,
        address recipient
    );
    event SwapOfferAccepted(uint256 offerId);
    event SwapOfferCanceled(uint256 offerId);

    function createSwapOffer(
        address tokenOffered,
        uint256 amountOffered,
        address tokenRequested,
        uint256 amountRequested,
        address recipient
    ) external {
        require(amountOffered != 0 && amountRequested != 0, "Amounts must be greater than zero");
        require(IERC20(tokenOffered).balanceOf(msg.sender) >= amountOffered, "Insufficient balance for offered token");
        require(IERC20(tokenOffered).transferFrom(msg.sender, address(this), amountOffered), "Transfer of offered token failed");

        swapOffers[nextOfferId] = SwapOffer(
            msg.sender,
            recipient,
            tokenOffered,
            tokenRequested,
            amountOffered,
            amountRequested,
            false,
            false
        );
        emit SwapOfferCreated(nextOfferId, msg.sender, tokenOffered, amountOffered, tokenRequested, amountRequested, recipient);
        nextOfferId++;
    }

    function acceptSwapOffer(uint256 offerId) external {
        SwapOffer storage offer = swapOffers[offerId];
        require(!offer.accepted, "Offer already accepted");
        require(!offer.canceled, "Offer was canceled");
        require(
            offer.recipient == address(0) || offer.recipient == msg.sender,
            "Not authorized to accept this offer"
        );

        require(IERC20(offer.tokenRequested).balanceOf(msg.sender) >= offer.amountRequested, "Insufficient balance for requested token");
        require(IERC20(offer.tokenRequested).transferFrom(msg.sender, offer.offerer, offer.amountRequested), "Transfer of requested token failed");

        offer.accepted = true;
        emit SwapOfferAccepted(offerId);

        // Transfer offered token from contract to acceptor
        require(IERC20(offer.tokenOffered).transfer(msg.sender, offer.amountOffered), "Transfer of offered token failed");
    }

    function cancelSwapOffer(uint256 offerId) external {
        SwapOffer storage offer = swapOffers[offerId];
        require(msg.sender == offer.offerer, "Not authorized to cancel this offer");
        require(!offer.accepted, "Cannot cancel an accepted offer");

        offer.canceled = true;
        emit SwapOfferCanceled(offerId);

        // Return offered token to the offerer
        require(IERC20(offer.tokenOffered).transfer(offer.offerer, offer.amountOffered), "Return transfer of offered token failed");
    }
}

